function Chatbot (props) {
  return (
    <div>
      <header>
        Chatbot
      </header>
      <div>
        {props.data[0].title}
        <Chats />
        <Channels />
      </div>
    </div>
  )
}

const Channels = () => (
  <div>
    Channels
  </div>
)

function Chats () {
  return (
    <div>
      <header>
        Chats
      </header>
    </div>
  )
}

export default Chatbot
